import styled from "styled-components";

export const InventoryContainer = styled.div`
    font-size: calc(15px + 2vmin);
    font-family: "Cursive";
`;

export const Logo = styled.img`
    height: 20vmin;
    pointer-events: none;
`;

export const ButtonStyle = styled.div`
    display: flex;
    justify-content: center;
`;
